import { _ } from 'streamline-runtime';
import * as core from 'syracuse-core';
import { ASYRRCV } from './ASYRRCV';
export const exported = true;

const tracerJs = core.getTracer("etna.supervisor");

export function PARVAL(_: _,  arcv: ASYRRCV, paramcod: string) {
	const paramval = arcv.paramval(_, paramcod);

	tracerJs.debug && tracerJs.debug("PARVAL(" + paramcod + ")=" + paramval);
	return paramval;
};